Prefeito (PSD) e vice (PL) da cidade presos por corrupção;
As crianças sem transporte escolar;
O número de animais abandonados na explodindo;
Secretária de saúde afastada por favorecer parentes na fila de consultas e exames;
Falta de coleta de lixo reciclável;
Trânsito caótico...

A prefeita:

➡️ Secretária de Saúde debochando das filas nos postos de Saúde;

➡️ Larvas na merenda de uma escola municipal em Itajaí;

➡️ 19 prefeitos presos suspeitos de corrupção;

➡️ QPessoas em situação de rua sendo tratadas de forma absolutamente desumana;

A DIREITA ESTÁ DESTRUINDO SANTA CATARINA!

